import React from "react";
import { useEffect, useState } from "react";
import { Link } from "react-router-dom";
import bootstrap from "bootstrap/dist/css/bootstrap.min.css";
import bookingservice from "../services/bookingservice";
import AuthService from "../services/auth.service";
let p = localStorage.getItem("username");
let t = localStorage.getItem("train_name");
let e = localStorage.getItem("email");
let tn = localStorage.getItem("train_no");
let fn = localStorage.getItem("fname");
let ln = localStorage.getItem("lname");
let age = localStorage.getItem("age");
let bookingId = localStorage.getItem("bookingId");
let start_from = localStorage.getItem("start_from");
let destination = localStorage.getItem("destination");
let coach_no = localStorage.getItem("coach_no");
let seat_no = localStorage.getItem("seat_no");

const Fullticket = () => {
  const [user, setFaculty] = useState([]);

 const [booking, setBooking] = useState([]);
  const init = (e) => {
    bookingservice.getbookingEmail(e)
      .then((response) => {
        console.log("Printing all booking ", response.data);
        setBooking(response.data);
      })
      .catch((error) => {
        console.log("Something went wrong", error);
      });
  };

  return (
    <div className="grid-container1">
      <div className="item2" style={{ marginLeft: "28rem", width: "35 rem" }}>
        {/* <p> Name:{p}</p>

        <p>Train Name:{t}</p>

        <p>First Name:{fn}</p>

        <p>Last Name:{ln}</p>

        <p>train No.:{tn}</p>

        <p>email:{e}</p>
        <p>age:{age}</p>

        <p>Start from :{start_from}</p>
        <p>destination:{destination}</p>
        <p>coach no:{coach_no}</p>
        <p>seat no:{seat_no}</p> */}
        <div className="tlist">
          <table className="table table-bordered table-dark table-striped">
            <thead className="thead-light">
              <tr>
                <th> Train Name</th>
                <th> Train No</th>
                <th> FirstName</th>
                <th> LastName</th>
                <th> Age</th>
                <th> Start from</th>
                <th> Destination</th>
                <th> emailId</th>
                <th> seat no</th>
                <th> coach no</th>

                <th> Actions </th>
              </tr>
            </thead>
            <tbody>
              {booking.map((bookings) => (
                <tr key={bookings.id}>
                  <td>{bookings.train_name}</td>
                  <td>{bookings.train_no}</td>
                  <td>{bookings.fname}</td>
                  <td>{bookings.lname}</td>
                  <td>{bookings.age}</td>
                  <td>{bookings.start_from}</td>
                  <td>{bookings.destination}</td>
                  <td>{bookings.emailId}</td>
                  <td>{bookings.seat_no}</td>
                  <td>{bookings.coach_no}</td>
                  <td>
                    {" "}
                    <button
                      className="btn btn-danger ml-2"
                      onClick={() => {
                        handleDelete(bookings.id);
                      }}
                    >
                      Delete
                    </button>
                    <Link
                      className="btn btn-warning"
                      to={`/booking/edit/${bookings.id}`}
                    >
                      Update
                    </Link>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
        <Link className="btn btn-warning" to={`/payment`}>
          Payment
        </Link>
      </div>
    </div>
  );
};

export default Fullticket;
